import { Button } from 'bootstrap';
import PropTypes from 'prop-types'


const Header = ({title}) => {
  return (
  <header class='header'>
    <h1>{title}</h1>
    
  </header>
  );
}

Header.defaultProps = {
    title: 'Task Tracker',
}

Header.prototype = {
    title: PropTypes.string.isRequired,
}

// CSS in JS
